import { useStyle } from 'primevue/usestyle';

var styles = "
.p-hidden-accessible {
    border: 0;
    clip: rect(0 0 0 0);
    height: 1px;
    margin: -1px;
    overflow: hidden;
    padding: 0;
    position: absolute;
    width: 1px;
}

.p-hidden-accessible input,
.p-hidden-accessible select {
    transform: scale(0);
}

.p-overflow-hidden {
    overflow: hidden;
}
";
var _useStyle = useStyle(styles, {
    name: 'base',
    manual: true
  }),
  loadBaseStyle = _useStyle.load;
var Base = {
  styles: styles
};

export { Base as default, loadBaseStyle };
